import React from "react";

const Button = (props) => {
  return (
    <div
      style={{
        cursor: "pointer",
        height: props.type ? 50 : 40,
        width: props.type ? 250 : 130,
        backgroundColor: props.type ? "white" : props.color,
        color: "white",
        textAlign: "center",
        justifyContent: "center",
        fontSize: 18,
        paddingTop: props.type ? 10 : 5,
        borderRadius: 5,
        opacity: props.type ? 0.5 : 0,
      }}
    >
      {props.text}
    </div>
  );
};

export default Button;
